import React from 'react';


const Naigation = ({onRouteChange}) => {
	return (
	  <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
	    <p onClick={() => onRouteChange('sign')} className = 'f3 link dim black underline pa3 pointer'>Sign Out</p>
	  </nav>

	);

}

export default Naigation;
